paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 3:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 2);
            }

            return normalizedValue;
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 300 ? 300 : value));
            let normalizedValue = (value - 0) / (300 - 0);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 500 ? 500 : value));
            let normalizedValue = (value - 0) / (500 - 0);
            return normalizedValue;
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1000 ? 1000 : value));
            let normalizedValue = (value - 0) / (1000 - 0);
            return normalizedValue;
        }
    case 6:
        {
            value = (value < 0 ? 0 : (value > 1840 ? 1840 : value));
            let normalizedValue = (value - 0) / (1840 - 0);
            return normalizedValue;
        }
    case 5:
        {
            value = (value < 0 ? 0 : (value > 96000 ? 96000 : value));
            let normalizedValue = (value - 0) / (96000 - 0);
            return normalizedValue;
        }
    case 0:
        {
            value = (value < 20 ? 20 : (value > 20000 ? 20000 : value));
            let normalizedValue = (value - 20) / (20000 - 20);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 3:
        {
            {
                value = this.applyStepsToNormalizedParameterValue(value, 2);
            }

            {
                return 0 + value * (1 - 0);
            }
        }
    case 2:
        {
            {
                return 0 + value * (300 - 0);
            }
        }
    case 1:
        {
            {
                return 0 + value * (500 - 0);
            }
        }
    case 4:
        {
            {
                return 0 + value * (1000 - 0);
            }
        }
    case 6:
        {
            {
                return 0 + value * (1840 - 0);
            }
        }
    case 5:
        {
            {
                return 0 + value * (96000 - 0);
            }
        }
    case 0:
        {
            {
                return 20 + value * (20000 - 20);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 20000 ? 20000 : (v < 20 ? 20 : v));
            return v;
        }
    case 1:
        {
            v = (v > 500 ? 500 : (v < 0 ? 0 : v));
            return v;
        }
    case 2:
        {
            v = (v > 300 ? 300 : (v < 0 ? 0 : v));
            return v;
        }
    case 3:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));

            {
                const oneStep = 1 / 1;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    case 4:
        {
            v = (v > 1000 ? 1000 : (v < 0 ? 0 : v));
            return v;
        }
    case 5:
        {
            v = (v > 96000 ? 96000 : (v < 0 ? 0 : v));
            return v;
        }
    case 6:
        {
            v = (v > 1840 ? 1840 : (v < 0 ? 0 : v));
            return v;
        }
    default:
        return value;
    }
}
